import React from 'react';

function NavBar() {
  return React.createElement(
    'nav',
    { className: 'bg-blue-600 text-white p-4 sticky top-0 z-50' },
    React.createElement(
      'ul',
      { className: 'flex justify-center space-x-6' },
      React.createElement(
        'li',
        null,
        React.createElement(
          'a',
          { href: '#hero', className: 'hover:underline' },
          'Home'
        )
      ),
      React.createElement(
        'li',
        null,
        React.createElement(
          'a',
          { href: '#about', className: 'hover:underline' },
          'About'
        )
      ),
      React.createElement(
        'li',
        null,
        React.createElement(
          'a',
          { href: '#projects', className: 'hover:underline' },
          'Projects'
        )
      ),
      React.createElement(
        'li',
        null,
        React.createElement(
          'a',
          { href: '#contact', className: 'hover:underline' },
          'Contact'
        )
      )
    )
  );
}

export default NavBar;
